import './App.css';
import React, { useState, useEffect } from 'react';

function App() {
  const [numbers, setNumbers] = useState([]);
  const [numberCount, setNumberCount] = useState(100);

  useEffect(()=>{
    for (let index = 0; index < numberCount; index++) {
      setNumbers(numbers => [...numbers, 5]);
    }
  }, []);

  return (
    <div className="App">
      <div>PENIS</div>
      {numbers.map(x => <div>{x}</div>)}
    </div>
  );
}

export default App;
